def make_palindrome(string: str) -> str:
    """ Find the shortest palindrome that begins with the supplied string. """

    if not string:
        return ""

    for i in range(len(string)):
        # Check if the string[i:] is a palindrome
        if string[i:] == string[i:][::-1]:
            # If it is a palindrome, return the concatenation of the reversed prefix and the original string
            return string[:i][::-1] + string

