def encrypt(s):
    alphabet = 'abcdefghijklmnopqrstuvwxyz'
    encrypted = ''

    for char in s:
        if char.isalpha():
            char_index = alphabet.index(char.lower())
            encrypted_char_index = (char_index + 2 * 2) % 26
            if char.isupper():
                encrypted += alphabet[encrypted_char_index].upper()
            else:
                encrypted += alphabet[encrypted_char_index]
        else:
            encrypted += char

    return encrypted

