def do_algebra(operators, operands):
    result = operands[0]
    for i in range(len(operators)):
        if operators[i] == '+':
            result += operands[i + 1]
        elif operators[i] == '-':
            result -= operands[i + 1]
        elif operators[i] == '*':
            result *= operands[i + 1]
        elif operators[i] == '//':
            result //= operands[i + 1]
        elif operators[i] == '**':
            result **= operands[i + 1]
    return result

